import React, { useState } from "react";
import styles from "../Aievents.module.css";

export default function Aievents() {
  const [currentDate, setCurrentDate] = useState(new Date());
  const [selectedDateIndex, setSelectedDateIndex] = useState(null);

  const updateWeek = (days) => {
    setCurrentDate(new Date(currentDate.setDate(currentDate.getDate() + days)));
  };

  const getDayName = (date) => date.toLocaleDateString('en-US', { weekday: 'short' });
  const getMonthName = (date) => date.toLocaleDateString('en-US', { month: 'short' });

  const handleDateSelect = (index) => {
    setSelectedDateIndex(index);
    console.log("Selected date:", new Date(currentDate.getTime() + index * 86400000).toDateString());
  };

  const renderDates = () => {
    return Array.from({ length: 7 }, (_, i) => {
      const date = new Date(currentDate);
      date.setDate(currentDate.getDate() + i);
      const isSelected = i === selectedDateIndex;

      return (
        <div 
          key={i} 
          className={`${styles.dateContainer} ${isSelected ? styles.selectedDate : ''}`}
          onClick={() => handleDateSelect(i)}
        >
          <div className={styles.dateText}>
            {date.getDate()} {getMonthName(date)}
          </div>
          <div className={styles.dayText}>{getDayName(date)}</div>
        </div>
      );
    });
  };

  return (
    <div className={styles.eventsDesktop}>
      <div className={styles.header}>
        <div className={styles.titleContainer}>
          <h1 className={styles.aiEvents}>AI Events</h1>
          <p className={styles.subtitle}>List of events triggered by cameras</p>
        </div>
      </div>

      <div className={styles.content}>
        <div className={styles.dateList}>{renderDates()}</div>
        <div className={styles.controls}>
          <div className={styles.deviceSelector}>
            <select id="device" name="device">
              <option value="all">All Device</option>
            </select>
          </div>
          <div className={styles.weekNavigation}>
            <button className={styles.weekButton} onClick={() => updateWeek(-7)}>previous week</button>
            <button className={styles.weekButton} onClick={() => updateWeek(7)}>next week</button>
          </div>
        </div>
      </div>

      <div className={styles.tabs}>
        <button className={styles.tabButton}>Events</button>
        <button className={styles.tabButton}>Notifications</button>
        <button className={styles.tabButton}>Reports</button>
      </div>

      <div className={styles.filterSection}>
        <select id="detection-models" name="detection-models" className={styles.dropdown}>
          <option value="all">All detection models</option>
          <option value="motion">Motion detection</option>
          <option value="humanoid">Humanoid detection</option>
          <option value="face">Face detection</option>
          <option value="line">Line crossing detection</option>
          <option value="area">Area detection</option>
          <option value="baggage">Unattended baggage detection</option>
          <option value="object">Missing object detection</option>
        </select>
        <button className={styles.clearButton}>clear</button>
      </div>
    </div>
  );
}
